int carote::Model::JntToTau
(
	KDL::JntArray _q,
	const KDL::JntArray& _qp,
	const KDL::JntArray& _qpp,
	KDL::JntArray& _tau
)
{
	// update dynamic model
	updateInertia(_q);
	updateCoriolisCentrifugal(_q,_qp);
	updateGravity(_q);

	// we assume that tau has been resized accordingly
	// with the number of joints of the robot model.
	_tau.data=dyn_B_*_qpp.data+dyn_S_*_qp.data+dyn_g_;

	return 0;
}

const Eigen::MatrixXd& carote::Model::getInertiaMatrix(void) const
{
	return dyn_B_;
}

const Eigen::MatrixXd& carote::Model::getCoriolisCentifugalTerms(void) const
{
	return dyn_S_;
}

const Eigen::VectorXd& carote::Model::getGravityTerms(void) const
{
	return dyn_g_;
}

